window.bookSummaryJSON = "<p><b>\"I'll ravish you for hours. Days. I won't ever stop.\" That's the Fae Kings' ritual of claiming. Sorry I asked.</b> </p> <p>The three Fae kings insist I'm their fated mate, and they're terrible at sharing. </p> <p>I know I should turn my back on them before they ruin me. </p> <p>They're too ruthless, feral, possessive, and well, too hot for me to feel safe. </p> <p>A girl would have a better chance of swimming with sharks than walking among the predatory Fae, let alone tangling with them between the sheets. </p> <p>But did I adhere to my own advice? </p> <p>And now my unbridled lust complicates everything, leading me straight into the Dawn Queen's trap. To claim the kings for herself, she thrusts me into the Wild Hunt - a deadly game no one has ever escaped. </p> <p><i>Fever Fae</i> is a full-length Reverse Harem fantasy romance perfect for fans of Ilona Andrews, Sarah J. Maas, Laura Thalassa, C. N. Crawford, K.F. Breene, Karen Marie Morning, Leia Stone, Jaymin Eve, and Amelia Hutchins.</p>"; 
